const mongoose = require("mongoose");

const adminSchema = new mongoose.Schema({
  fullName: {
    type: String,
    required: true,
  },
  emailAddress: {
    type: String,
    required: true,
  },
  password: {
    type: String,
    required: true,
  },
  postedBy: {
    type: String,
    default: "admin",
  },
  // profileImage: {
  //   type: String,
  //   default:
  //     "data:image/png;base64,",
  // },
});

const Admin = mongoose.model("admins", adminSchema);

module.exports = { Admin };
